import React, { Component } from 'react';
import AppHeader from "../AppHeader/AppHeader";
import AppFooter from '../AppFooter/AppFooter';

import './App.css';

class App extends Component {
  render() {
    return (
      <React.Fragment>
        <AppHeader />
        <AppFooter />
      </React.Fragment>
    );
  }
}

export default App;
